import React from 'react';
import Login from './login';
import Image from './image'

const FirstPage = () => {
    return (
        <React.Fragment>
            <Image/>
            <span className='form-container'>
                <Login/>
            </span>
        </React.Fragment>
     );
}
 
export default FirstPage;
